/* eslint-disable strict, prefer-template, no-console */
"use strict";

const OOSwagClient = require("./oo-swag-client.js");

OOSwagClient.create()
  .then(client => {
    console.log(client);
    const meta = {
      name: "hello",
      log: (a, b) => console.log(a, b)
    };
    client.addPasswordAuth("authToken", process.env.OO_AUTH_TOKEN, "");
    client
      .withMeta(meta)
      .getAccountProfile()
      .then(resp => {
        console.log(resp);
      })
      .catch(err => {
        console.log(err);
      });
  })
  .catch(err => {
    console.log("create failed", err);
  });
